// import Navigationbar from "./navbar";
import Link from "next/Link";
import React from "react";

export default function Index() {
	return (
		<div>
			{/* <Navigationbar />
			<h1>Index Page</h1> */}
			<div>
				<li>
					<Link href="/index">
						<a>Home</a>
					</Link>
				</li>
				<li>
					<Link href="/article/test">
						<a>Go to articles</a>
					</Link>
				</li>
				<li>
					<Link href="/contact" as="/contact">
						<a>Contact</a>
					</Link>
				</li>
			</div>
		</div>
	);
}
